import { Text } from 'react-native';

const Header = () => {
  return (
    <View>
      <Text>Academy header</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  header: {
    flex: 1,
    backgroundColor: 'orange',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

export default Header;
